  authDomain: "print-519dc.firebaseapp.com",
  projectId: "print-519dc",
  storageBucket: "print-519dc.appspot.com",
  messagingSenderId: "1096298789041",
  appId: "1:1096298789041:web:a23f69aa0948d142fa0a90",
  measurementId: "G-NLYMV6505P",
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

const auth = getAuth();
export { app, auth };
